-- Table structure for jd_order_after
-- ----------------------------
DROP TABLE IF EXISTS `jd_order_after`;
CREATE TABLE `jd_order_after`  (
  `id` bigint(0) NOT NULL,
  `shop_id` int(0) DEFAULT NULL COMMENT '店铺id',
  `apply_id` bigint(0) DEFAULT NULL COMMENT '申请单号',
