  `return_logistics_code` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL COMMENT '退货物流单号',
  `receive_time` datetime(0) DEFAULT NULL COMMENT '收货时间',
